// Nav.js
import React from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {

  useEffect(() => {
    const menuToggle = document.getElementById("menu-toggle");
    const wrapper = document.getElementById("wrapper");

    if (menuToggle && wrapper) {
      menuToggle.addEventListener("click", function (e) {
        e.preventDefault();
        wrapper.classList.toggle("toggled");
      });
    }

    // Cleanup the event listener on component unmount
    return () => {
      if (menuToggle) {
        menuToggle.removeEventListener("click", function (e) {
          e.preventDefault();
          wrapper.classList.toggle("toggled");
        });
      }
    };
  }, []);

  return (
    <div id="wrapper" className="d-flex">
      <div id="sidebar" className="bg-light border-right">
        <div className="sidebar-heading">
          <img className='logo' src={`${process.env.PUBLIC_URL}/vivian-source/logo.jpg`} alt="Logo" />
        </div>
        <div className="list-group list-group-flush">
          <Link to="/" className="list-group-item list-group-item-action bg-light">Trang Chủ</Link>
          <Link to="/roomview" className="list-group-item list-group-item-action bg-light">Xem Phòng</Link>
          <Link to="/activity" className="list-group-item list-group-item-action bg-light">Sinh Hoạt</Link>
          <Link to="/service" className="list-group-item list-group-item-action bg-light">Dịch Vụ</Link>
          <Link to="/contact" className="list-group-item list-group-item-action bg-light">Liên Hệ</Link>
          <Link to="/book-room" className="list-group-item list-group-item-action bg-light book-link">Đặt Phòng</Link>
        </div>
      </div>

      <div id="page-content-wrapper">
        <nav className="navbar navbar-expand-lg navbar-light bg-light border-bottom">
          <button className="btn btn-primary" id="menu-toggle">Toggle Menu</button>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav ml-auto mt-2 mt-lg-0">
              <li className="nav-item active">
                <Link className="nav-link" to="/">Home <span className="sr-only">(current)</span></Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/roomview">Xem Phòng</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/activity">Sinh Hoạt</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/service">Dịch Vụ</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/contact">Liên Hệ</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link book-link" to="/book-room">Đặt Phòng</Link>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    </div>
  );
};

export default Nav;
